	add("milt", "{\"term\":\"milt\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) \u0027milte\u0027 \u0027milt\u0027 (milt, spleen) from Proto-germanic {{m|gem-pro|*meltǭ||spleen}}, from Proto-indo-european {{m|ine-pro|*(s)meld-||to beat, grind, crush, weaken}}. Cognate to German \u0027milz\u0027 Dutch \u0027milt\u0027 Danish \u0027milt\u0027 Norwegian \u0027milt\u0027 Swedish \u0027mjälte\u0027 Outside Germanic, with Albanian \u0027mëlçi\u0027 (liver)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The spleen, especially of an animal bred for food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"we see that certaine apprehensions engender a blushing-red colour, others a palenesse; that some imagination doth only worke in the \u0027\u0027milt\u0027\u0027, another in the braine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Robert Nye, \u0027The Facts of Life\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Adam Kadmon had pneumonia. Friar Goat cured it by tying a bullock’s \u0027\u0027milt\u0027\u0027 to the soles of the lad’s feet, and burying the milt afterwards. Adam Kadmon immediately contracted the thrush\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Fish semen\", \"priority\":6}]}, \"synonyms\":{}}");

	add("milab", "{\"term\":\"milab\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|military|abduction|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deceitful military operation performed to convince the targets of the operation that they have had an encounter with extraterrestrial beings which is actually a staged plo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 Helmut Lammer Ph.D. \u0027Preliminary Findings Of Project MILAB: Evidence For Military Kidnappings Of Alleged UFO Abductees\u0027 published at [http://www.alienjigsaw.com/Part_IV/milab.html The Alien Jigsaw], [http://www.mindcontrolforums.com/lammer1.htm Mind Control Forums] and on many other web sites\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Recently, some UFO abductees have reported that they have also been kidnapped by military intelligence personnel (MILAB) and taken to hospitals and/or military facilities, some of which are described as being underground\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027 A letter from Dr. Helmut Lammer of the Austrian Space Agency to Dr. Steven Greer of the Disclosure Project, published in Greer, Steven M. \u0027Extraterrestrial Contact: The Evidence and Implications\u0027. Crossing Point Inc, ISBN 978-0967323800, page 8\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I will send you today a copy of the MILAB (Military Abductions) manuscript for review\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Encyclopedic entry in William J. Birnes \u0027The UFO Magazine UFO Encyclopedia: The Most Comprehensive Single-Volume UFO Reference in Print\u0027, Pocket Books, ISBN 978-0743466745, page 21\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Military Abductions (MILABS\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Abductions conducted by members of the U.S. military for the purposes of either learning what happened to real alien abductees or as part of a military or CIA \u0026quot;mind control\u0026quot; program\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 Brenda Denzler \u0027The Lure of the Edge: Scientific Passions, Religious Beliefs, and the Pursuit of UFOs\u0027, University of California Press, ISBN 978-0520239050, page 6\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Whatever the answer might be, the idea of military involvement in abductions became a standard feature of the abduction scenario by the mid-1990s and, like the subject of implants, became a specialized focus for an on-going study by a small group of ufologists who formed Project MILAB\", \"priority\":10}]}, \"synonyms\":{}}");

