	add("miles", "{\"term\":\"miles\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Proto-Germanic\"], \"text\":\"From Old french (842-ca. 1400) given name \u0027milo\u0027 of problematic origin, possibly from an unknown Proto-germanic element, or a short form of names beginning with \u0027mil-\u0027 \u0026quot;grace, favor\u0026quot;. The English form is associated by folk etymology with Latin {{m|la|mīles||soldier}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027 w:Henry Wadsworth Henry Wadsworth Longfellow, \u0027s:The Courtship of Miles Standish/Miles The Courtship of Miles Standish\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Clad in doublet and hose, and boots of Cordovan leather, / Strode, with a martial air, \u0027\u0027Miles\u0027\u0027 Standish the Puritan Captain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027 , \u0027There but for the\u0027, Hamish Hamilton, ISBN 9780241143407, page 191\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Just one thing, if I may, Mark said. It\u0027s \u0027\u0027Miles\u0027\u0027, his name. Not Milo\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Yeah, I know, Anna\u0027s always going on about that too. But Milo\u0027s better, Milo\u0027s got something about it, hasn\u0027t it? the man said. It\u0027s catchier. It\u0027s catching on round the camp, Milo, where \u0027\u0027Miles\u0027\u0027 sounds a bit, well, wet. A bit middle class, you know\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"also derived from a form of Michael\", \"priority\":6}]}, \"synonyms\":{}}");

