	add("millennium", "{\"term\":\"millennium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From post-classical Latin \u0027millennium\u0027 from Latin {{m|la|mīlle||thousand}} + \u0027\u0027 (from \u0027annus\u0027 () .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A period of time consisting of one thousand years\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Dan Pearson, \u0027The Guardian\u0027, 24 Mar 2013\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Magnolias are some of the most primitive of our flowering trees, and fossils dating back \u0027\u0027millennia\u0027\u0027 prove that they have had little need to evolve\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The period of one thousand years during which Christ will reign on earth (according to Millenarianist interpretations\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, ‘Tobermory’, \u0027The Chronicles of Clovis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An archangel ecstatically proclaiming the \u0027\u0027Millennium\u0027\u0027, and then finding that it clashed unpardonably with Henley and would have to be indefinitely postponed, could hardly have felt more crestfallen than Cornelius Appin at the reception of his wonderful achievement\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0027Religion and the Decline of Magic\u0027, Folio Society 2012, p. 137\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the end of the world would be heralded by a series of spectacular and symbolic events […]. According to most commentators, this \u0027\u0027millennium\u0027\u0027 had already begun\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Vanished Kingdoms\u0027, Penguin 2012, p. 117\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Conrad\u0027s later years unfolded in the shadow of the coming \u0027\u0027Millennium\u0027\u0027, when the end of the world was forecast\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A period of universal happiness, peace or prosperity; a utopia\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, p. 318\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"But the aggressive members of society are always tending to become bullies, robbers, and swindlers; and no one believes that such a state of things as we now live in is the \u0027\u0027millennium\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The year in which one period of one thousand years ends and another begins, especially the year 2000\", \"priority\":14}]}, \"synonyms\":{}}");

	add("miller", "{\"term\":\"miller\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"for a miller\", \"priority\":1}]}, \"synonyms\":{}}");

	add("millerandage", "{\"term\":\"millerandage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A viticultural problem in which grape bunches contain berries that differ greatly in size and maturity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Millerandage\u0027\u0027 is most commonly caused by cold or bad weather during the flowering stage of the vines. It impairs the quality of wine made from the grapes\", \"priority\":2}]}, \"synonyms\":{}}");

