	add("milling", "{\"term\":\"milling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The series of notches around the edge of a coin, placed there during minting so that it can be told if some of the metal from the edge is removed. Removing metal from a coin was common practice during earlier times when coins made of precious metals circulated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A grinding process using a mill\", \"priority\":2}]}, \"synonyms\":{}}");

