	add("millions", "{\"term\":\"millions\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1815?\u0027\u0027: Captain Dugald Carmichael, F.L.\u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;s\u0026lt;/span\u0026gt;., the Rev. Colin Smith (editor), \u0026lt;i\u0026gt;Biographical Notice of the late Captain Dugald Carmichael, F.L.\u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;s\u0026lt;/span\u0026gt;.\u0026lt;/i\u0026gt;, volume 2, \u0026gt;page 343; quoted in\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027: William Jackson Hooker (editor), \u0027Botanical miscellany \u0027, [http://books.google.co.uk/books?id\u003dFTUFAAAAQAAJ\u0026amp;pg\u003dPA40\u0026amp;dq\u003d%22333+millions%2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"PPA40,M1 page 40\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“ The Hindoo bears a superstitious veneration for every thing possessed of life : the Briton venerates nothing, but sacrifices all, without distinction, to his appetite or his amusement. The former worships 333 \u0027\u0027millions\u0027\u0027 of gods, male or female, some with two arms, some with two hundred; the latter, so far as can be gathered from his actions, worships neither god nor goddess. ”\", \"priority\":4}]}, \"synonyms\":{}}");

	add("millipede", "{\"term\":\"millipede\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027millipeda\u0027 (wood louse) from \u0027mille\u0027 (thousand) + \u0027pedis\u0027 (foot)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many elongated arthropods, of the class Diplopoda, with cylindrical bodies that have two pairs of legs for each one of their 20 to 100 or more body segments\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Rod Preston-Mafham, \u0027The Encyclopedia of Land Invertebrate Behaviour\u0027, [http://books.google.com.au/books?id\u003dsDpagGxJw3AC\u0026amp;pg\u003dPA14\u0026amp;dq\u003d%22millipede%22%7C%22millipedes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dLDiMU8LqB8HEkgWkqoGICw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22millipede%22%7C%22millipedes%22\u0026amp;f\u003dfalse page 14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"With one or two exceptions, male \u0027\u0027millipedes\u0027\u0027 make direct contact with the female and transfer sperm via a pair of modified front legs (gonopods) which have been charged with semen from the genitalia situated towards the rear of the body\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Thomas Eisner, \u0027For Love of Insects\u0027, [http://books.google.com.au/books?id\u003dKi9djoKOm-0C\u0026amp;pg\u003dPA276\u0026amp;dq\u003d%22millipede%22%7C%22millipedes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dLDiMU8LqB8HEkgWkqoGICw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22millipede%22%7C%22millipedes%22\u0026amp;f\u003dfalse page 276\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When alive, \u0027\u0027millipedes\u0027\u0027 maintain tension in these\u0026lt;sup\u0026gt;[intersegmental]\u0026lt;/sup\u0026gt; muscles and are therefore difficult to straighten out when coiled\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Boris A. Byzov, \u00274: Intestinal Microbiota of \u0027\u0027Millipedes\u0027\u0027\u0027, Helmut König, Ajit Varma (editors), \u0027Intestinal Microorganisms of Termites and Other Invertebrates\u0027, [http://books.google.com.au/books?id\u003dsbBG4-G7arQC\u0026amp;pg\u003dPA89\u0026amp;dq\u003d%22millipede%22%7C%22millipedes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dLDiMU8LqB8HEkgWkqoGICw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22millipede%22%7C%22millipedes%22\u0026amp;f\u003dfalse page 89\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Soil \u0027\u0027millipedes\u0027\u0027 (Diplopoda) possess a specific gut microbiota that differs from microbial communities in soil and leaf litter\", \"priority\":10}]}, \"synonyms\":{}}");

