	add("millstone", "{\"term\":\"millstone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large round stone used for grinding grain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A coarse-grained sandstone used for making such stones; millstone gri\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A heavy responsibility that is difficult to bear\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Paying the mortgage every month is a \u0027\u0027millstone\u0027\u0027 round their necks\", \"priority\":4}]}, \"synonyms\":{}}");

